from typing import List
from collections import defaultdict


class Solution:
    def find(self, s, index, trie):
        answer = 0
        if '$' in trie:
            answer = trie['$']

        for k in trie:
            if s.find(k, index + 1) >= index:
                answer += self.find(s, s.find(k, index + 1), trie[k])

        return answer

    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        trie = dict()
        for word in words:
            if word[0] not in trie:
                trie[word[0]] = dict()
            temp = trie[word[0]]
            for character in word[1:]:
                if character not in temp:
                    temp[character] = dict()

                temp = temp[character]
            if '$' not in temp:
                temp['$'] = 1
            else:
                temp['$'] += 1

        answer = 0
        for k in trie:
            answer += self.find(s, s.find(k), trie[k])

        return answer


